import React from 'react';
import { Panel, ArticleText } from './styles';

const Spotlight = () => (
  <Panel>
    <img
      src="https://blog.rocketseat.com.br/content/images/2019/07/Tipos-de-navegac-a-o-no-React-Native.png"
      alt="teste"
      width="500"
    />
    <ArticleText>
      <h1>Helloooo</h1>
    </ArticleText>
  </Panel>
);

export default Spotlight;
